import testdata from "./testfiles/testdata.json";
const DataRead = () => {
  const jsonfile = require("jsonfile");
  const file = testdata;

  jsonfile.readFile(file, (err, obj) => {
    if (err) console.error(err);
    console.dir(obj);
  });
};

export default DataRead;
